// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract SplitAssets {
    uint public assetValue;
    string public assetName;
    uint public maxOwnersNumber;
    uint public currentOwnersNumber;
    address[] public investorAddressList = new address[](10);
    int[] public investorPrecentList = new int[](10);
    uint public firstOwnerPrecent;

    function setAssetName(string memory name) public{
        assetName = name;
    }

    function setAssetValue(uint value) public{
        assetValue = value;
    }

    function getAssetName() public view returns (string memory){
        return assetName;
    }

    function getAssetValue() public view returns (string memory){
        return uint2str(assetValue);
    }
 
    function uploadAsset(string memory name, uint value, uint maxOwnerNumber, uint keepPrecent) public returns (string memory) {
        setAssetName(name);
        setAssetValue(value);
        //console.log("updating name to " + name);
        maxOwnersNumber = maxOwnerNumber;
        currentOwnersNumber = 1;
        investorAddressList[0] = msg.sender;
        investorPrecentList[0] = 100;
        firstOwnerPrecent = keepPrecent;

        return append('Asset Uploaded Successfully! Name: ', name, ", value: ", uint2str(assetValue), "");
    }

    function printAsset() public view returns (string memory){
        string memory details = append("Asset Name: ", getAssetName(), "\nAsset Value: ", getAssetValue(), "");
        return details;
    }

    function uint2str(uint i) internal pure returns (string memory){
        if (i == 0) return "0";
        uint j = i;
        uint length;
        while (j != 0){
            length++;
            j /= 10;
        }
        bytes memory bstr = new bytes(length);
        uint k = length - 1;
        while (i != 0){
            bstr[k--] = byte(uint8(48 + i % 10));
            i /= 10;
        }
    return string(bstr);
    }

    function append(string memory a, string memory b, string memory c, string memory d, string memory e) internal pure returns (string memory) {
        return string(abi.encodePacked(a, b, c, d, e));
    }

}
